webpackJsonp([0xaa32a12114e0],{352:function(e,t){e.exports={data:{markdownRemark:{html:'<p>This first week of the semester must have been the busiest week I\'ve experienced in NUS. Seriously. Two project meetings in the first week is unprecedented for me. </p>\n<p>One particular highlight of the week, was the CS3216 show-and-tell.The event left an impression on me because everyone in class had to share a "non-programming" talent, and I found it so hard to come up with one.</p>\n<!--more-->\n<p>The only things that I could think of were programming-related. My pet projects, my interests etc.</p>\n<p>I had only picked up programming less than two years ago. Yet, this made me realise how much programming had become my identity. That if I were to introduce myself to a complete stranger, <strong>the fact that I code</strong> would be among the few things I would say. </p>\n<p>More importantly, it made me realise how important it is for me to keep going at it. To keep learning and improving.</p>\n<blockquote>\n<p>If programming is to be my only talent, I had better be damn good at it.</p>\n</blockquote>',frontmatter:{title:"My 'Talent'",date:"20 August, 2012"},fields:{slug:"/2012/08/20/my-talent.html"}}},pathContext:{slug:"/2012/08/20/my-talent.html"}}}});
